import React from 'react';
import Product from './Product.js'
import vschoolProducts from './vschoolProducts.js'

function App() {

    const productComponents = vschoolProducts.map(num => {
            return( 
                <Product name={num.name} answer={num.price}  />
                )
            })
    return(
        <div>
            {productComponents}
        </div>
    )
}
export default App;
